## Inline Styles

The most basic way to style a react component is to use inline styles. Inline styles are defined as a JavaScript object with a style property for each CSS property you want to style. For example, to style a div with a red background color, you can use the following code:
```
const   MyComponent   =   ( )   =>   (
   < div   style = { {   backgroundColor :   'red'   } } >
    Hello World
   < / div >
) ;
```
In this example, we are using the style property to define a JavaScript object with a backgroundColor property set to the value red . This will cause the div to have a red background color.

## CSS Modules

CSS Modules allow you to write CSS in a scoped and modular way. To use CSS Modules in a react app, you need to create a CSS file and import it into your react component. For example, to create a CSS file with a red background color, you can use the following code:
```
. red   {
   background-color :   red ;
}
