Solution: Here is a possible implementation of this function written in Typescript:
```typescript
function getElapsedTime(post: { timestamp: number }) {
  const now = new Date();
  const then = new Date(post.timestamp);

  return Math.round((now - then) / 1000);
}
```
This function takes a post object as its argument and extracts the timestamp property from it. It then creates two new Date objects, one representing the current time and another representing the time when the post was made. The difference between these two dates is calculated in milliseconds and then divided by 1000 to convert it into seconds. Finally, the result is rounded off to the nearest integer and returned by the function.

